                            {任务类型}={④分布分析}
                            {数据分析指南中的相关内容}={xxx}
                            {任务}={xxx}
                            {数据格式示例}=xx (从ragproxyagent的发言中的{数据格式示例}中获取)
                            {数据地址}=xx  (从ragproxyagent的发言中获取)
                            {数据描述}=xx  (从ragproxyagent的发言中获取)
